import fiber from "./images/CoconutFiber.webp";
import peatblock from "./images/peatblock.webp";
import charcoal from "./images/charcoalbriquette.webp";

const ProductData = [
  {
    productID: "coconutfiber",
    image: fiber,
    name: "Coconut Fiber",
    desc: "Coconut Fiber is a natural fiber extracted from the outer husk of coconut.It can be used for a variety of products, usually for brushes, mattresses, doormats and rope.",
  },
  {
    productID: "coconutpeatblock",
    image: peatblock,
    name: "Coconut Peat Block",
    desc: "Coconut peat made from the separation of coconut fiber after drying. Cocopeat is a growing medium that has a fairly high air absorption capacity and can store more air than in the soil.It can be used and mixed with soil or not.",
  },
  {
    productID: "coconutcharcoalbriquette",
    image: charcoal,
    name: "Coconut Charcoal Briquette",
    desc: "Coconut CHARCOAL BRIQUETTE is made from Coconut shell charcoal.It produces more heat and lasts longer than ordinary charcoal.Coconut charcoal briquette usually used for grilling or barbecue and for smoking shisha/hookah.",
  },
];

export { ProductData };
